<br></div>


<div id="spec"><img src="http://image.rakuten.co.jp/tels/cabinet/01252734/img67128994.jpg"><br>
<h1>こだわりの質感と高い耐久性</h1>
<p>質感の良いメタルボディを採用。スタイリッシュな高級感とともに、優れた耐久性も実現しています。 </p>
<h1>2つのヒーターで、おいしさも倍増。</h1>
<p>抽出と保温を別々のヒーターで行う、デュアルヒーティングシステム。約94℃の抽出温度と約80℃の保温温度が、おいしさをいっそう引き立てます。保温プレートには、独立した温度制御機能をもつPTCヒーターを搭載しています。 </p>
<h1>ムラなく、しっかり抽出</h1>
<p>9つの穴からシャワー状にお湯が出る。シャワードリップ機能を採用。コーヒーパウダーにまんべんなくお湯を注げるため、ムラのない味わいを手軽に楽しめます。また、抽出中にガラスジャグを外してもドリッパーからコーヒーが漏れない、ドリップストップ機能も搭載しています。</p>
<h1>紙フィルターいらずで経済的</h1>
<img src="http://image.rakuten.co.jp/tels/cabinet/01252734/img69263316.jpg"><br>
<p>ペーパーレスフィルターを標準装備。洗ってくり返し使えるため、環境にやさしく、経済的にも優れています。</p>
<h1>新進気鋭のデザイナー Darren Mullen氏がデザイン</h1>
<br>
<img src="http://image.rakuten.co.jp/tels/cabinet/01252734/img67128996.jpg"><br>
